import React, { Component } from 'react'
import Head from './Head'
import Login from './Login'
import { CookiesProvider, withCookies } from 'react-cookie'
class Monitor extends Component {
    constructor() {
        super()
        this.state = {
            page: <html>hello</html>
        }
    }

    componentDidMount() {
        console.log(this.props)
        console.log(localStorage.getItem("loginStat"))
        let loginStat = localStorage.getItem("loginStat")

        if (loginStat === "0") {
            this.setState({
                page: <div><Login onLogin={this.Ch} /></div>
            })
        }
    }
    Ch = (r) => {
        console.log(r)
    }
    render() {
        return (
            <div>
                <CookiesProvider>
                    <Head />
                    {this.state.page}
                </CookiesProvider>
            </div>
        )
    }
}

export default withCookies(Monitor)
